/**
 * @param {number[]} nums
 * @return {number}
 */
var maxSubArray = function (nums) {
    let max = nums[0];
    let prev = nums;
    let next = [];
    nums.forEach(ele => {
        max = ele > max ? ele : max;
    });
    for (let len = 2; len <= nums.length; len++) {
        // console.log({ len })
        for (let i = 0; i <= nums.length - len; i++) {
            next[i] = /* typeof prev[i] !== 'undefined' ? */
                prev[i] + nums[i + len - 1]
            // :
            // 0;
            max = max < next[i] ? next[i] : max;
            // console.log({ i, len: nums.length, prev: prev[i], next: next[i], max })
        }
        prev = next;
        next = [];
        // console.log({prev})
    }
    // console.log(max);
    return max;
};
